import React from 'react';


const todos=props=>{
    return(
        <React.Fragment >
            <div className="row">
            <div className="">{props.task}</div>
            <div className="">{props.deadline}</div>
            <button className="">delete</button>
            </div> 
        </React.Fragment>
    )
}

export default todos;
